INSERT INTO `blog` (`title`, `sp_title`, `fr_title`, `id`, `post_id`, `description`, `sp_description`, `fr_description`, `thumb`, `sp_thumb`, `fr_thumb`, `category_id`, `body`, `sp_body`, `fr_body`, `status`, `views`, `sp_views`, `fr_views`, `slug`, `sp_slug`, `fr_slug`, `created_by`, `created_at`) VALUES
('5 Things We Learn from Joseph\'s Faith at Christmas', 'Cinco cosas que aprendemos de la fe de José en Navidad', '5 choses que nous apprenons de la foi de Joseph à Noël', 1, '12345', 'My childhood view of Christmas was colorful, clean, and pleasant. I remember Daddy marching down the church aisle at Christmas, singing, “We Three Kings.”', 'Mi visión infantil de la Navidad era colorida, limpia y agradable. Recuerdo a papá marchando por el pasillo de la iglesia en Navidad, cantando “Nosotros, los tres reyes”.', 'La vision de Noël de mon enfance était colorée, propre et agréable. Je me souviens que papa marchait dans l\'allée de l\'église à Noël en chantant « We Three Kings ». ', 'post-1.jpg', 'post-1.jpg', 'post-1.jpg', 1, '<div class=\"blog-description-article\">\r\n										<h2>Introduction</h2>\r\n										<p>My childhood view of Christmas was colorful, clean, and pleasant. I remember Daddy marching down the church aisle at Christmas, singing, “We Three Kings.” I had a sanitized view of camels, too — until I visited one that was filthy, by his own choice. He sometimes projected that filth of his in the direction of onlookers. My romantic view of a stable and the three wise men’s journey vanished.</p>\r\n										<p>Gone also is the childhood notion that the first Christmas was all joy and peace for the main characters. Mary and Joseph experienced a bevy of emotions and challenges that included betrayal, fear, and loneliness. In other words, the first Christmas offers a lot of hope for real people in a fallen world whose holiday celebrations fall short of the mythical ideal.</p>\r\n										<p>Most of us are familiar with Mary. But Joseph is also worth a deeper look. Let’s consider five lessons from Joseph’s faith that first Christmas. </p>\r\n									</div>\r\n									<div class=\"blog-description-article mt-3\">\r\n										<h2>Choosing Your Wallet</h2>\r\n										<p>Kindness and godliness go together. In fact, Proverbs tells us the righteous show regard even for their animals (Pro. 12:10). Our culture suffers from a dearth of kindness. Hateful comments on social media show even believers tearing down fellow believers. Joseph’s example of kindness can teach us a lot about faith in the midst of disappointment.</p>\r\n										<p>From a human viewpoint, Joseph had every right to be angry. His fiancé unexpectedly left town for three months and returned three months pregnant! Her story about an angel’s visit and still being a virgin—but pregnant—must have sent him reeling.</p>\r\n										<p>How could he have been so deceived about Mary’s character? And why would she make up such a ridiculous story about an angel’s visit to cover her betrayal? </p>\r\n										<h3>1. By Faith Joseph Displayed Kindness under Pressure</h3>\r\n										<p>Nunc viverra eleifend sapien ac blandit. Nam id elit tempor, tempor ante at, euismod nisl. Nullam ante lectus, luctus eget porttitor ut, dignissim non urna. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut turpis quam, porttitor vel vestibulum ut, venenatis non eros. In hac habitasse platea dictumst.</p>\r\n										<h3>2. By Faith Joseph Showed Courage</h3>\r\n										<blockquote><p>“But after he had considered this, an angel of the Lord appeared to him in a dream and said, ‘Joseph son of David, do not be afraid to take Mary home as your wife, because what is conceived in her is from the Holy Spirit’” (<a href=\"https://www.biblestudytools.com/matthew/1-20.html\">Matt. 1:20</a>).</p></blockquote>\r\n										<p>Why was Joseph afraid? The obvious answer is that he feared Mary was involved or had been with another man, that she was immoral and not the person he’d believed her to be. Since he hadn’t heard from God at this time, how could he believe Mary? How could he ever trust her? How could he raise another man’s child? .</p>\r\n										<h3>3. By Faith Joseph Received Guidance and Revelation</h3>\r\n										<p>God’s ways often baffle me. If I’d been directing the events of the first Christmas, I would have preempted the tension and misunderstanding between Mary and Joseph by sending the angel to Joseph before he met with Mary. I would have warned him about their need to flee before the middle of the night they had to leave. But God’s ways are not my ways—they are better (Is. 55:9). And so is His timing. God sent Joseph the direction he needed when he needed it, not before. He’ll do the same for me. </p>\r\n										<h3>4. By Faith Joseph Obeyed God</h3>\r\n										<p>Joseph demonstrates the obedience of faith. Three times when an angel spoke to him in a dream he immediately obeyed. His quick response meant fleeing, perhaps on foot, leaving behind what they couldn’t carry and starting over in a new location (Luke 2:13). One of lesser faith might have waited to finish and get paid for the carpentry project he was working on. </p>\r\n									</div>\r\n									<div class=\"blog-description-article mt-3\">\r\n										<h2>Conclussion</h2>\r\n										<p>At Christmas, we — especially parents and grandparents — don’t want our loved ones to feel disappointed or less than their friends. This can pressure us to spend more than we should. I appreciate that the Christmas story shows the humility of Joseph. At the circumcision of Jesus — God’s very Son — Mary and Joseph didn’t offer a lamb, but the lesser offering of a pair of doves or pigeons. Charles Ryrie says in the Ryrie Study Bible that this shows the family’s poverty.</p>\r\n										<p>When we’re tempted to react, feel sorry for ourselves, delay obedience, or overindulge this season, may Joseph’s example bolster our faith to live courageously and in step with our Savior.</p>\r\n									</div>', '<div class=\"blog-description-article\">\r\n										<h2>Introducción</h2>\r\n										<p>Mi visión infantil de la Navidad era colorida, limpia y agradable. Recuerdo a papá marchando por el pasillo de la iglesia en Navidad, cantando “Nosotros, los tres reyes”. También tenía una visión desinfectada de los camellos, hasta que visité uno que estaba sucio, por elección propia. A veces proyectaba esa inmundicia suya en dirección a los espectadores. Mi visión romántica de un establo y del viaje de los Reyes Magos se desvaneció.</p>\r\n										<p>Atrás también quedó la noción infantil de que la primera Navidad fue todo alegría y paz para los personajes principales. María y José experimentaron una serie de emociones y desafíos que incluían traición, miedo y soledad. En otras palabras, la primera Navidad ofrece mucha esperanza para las personas reales en un mundo caído cuyas celebraciones navideñas no alcanzan el ideal mítico.</p>\r\n										<p>La mayoría de nosotros estamos familiarizados con María. Pero José también merece una mirada más profunda. Consideremos cinco lecciones de la fe de José esa primera Navidad. </p>\r\n									</div>\r\n									<div class=\"blog-description-article mt-3\">\r\n										<h2>Elegir tu billetera</h2>\r\n										<p>La bondad y la piedad van juntas. De hecho, Proverbios nos dice que los justos muestran respeto incluso por sus animales (Pro. 12:10). Nuestra cultura sufre de una escasez de bondad. Los comentarios de odio en las redes sociales muestran que incluso los creyentes derriban a sus compañeros de creencia. El ejemplo de bondad de José puede enseñarnos mucho acerca de la fe en medio de la decepción.</p>\r\n										<p>Desde un punto de vista humano, José tenía todo el derecho a estar enojado. ¡Su prometido se fue inesperadamente de la ciudad por tres meses y regresó embarazada de tres meses! Su historia sobre la visita de un ángel y todavía siendo virgen, pero embarazada, debe haberlo hecho tambalearse.</p>\r\n										<p>¿Cómo pudo haberse engañado tanto respecto del carácter de Mary? ¿Y por qué inventaría una historia tan ridícula sobre la visita de un ángel para encubrir su traición?</p>\r\n										<h3>1. Por fe José mostró bondad bajo presión</h3>\r\n										<p>Nunc viverra eleifend sapien ac blandit. Nam id elit tempor, tempor ante at, euismod nisl. Nullam ante lectus, luctus eget porttitor ut, dignissim non urna. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut turpis quam, porttitor vel vestibulum ut, venenatis non eros. In hac habitasse platea dictumst.</p>\r\n										<h3>2. Por fe José mostró valor</h3>\r\n										<blockquote><p>“Pero después de considerar esto, un ángel del Señor se le apareció en sueños y le dijo: José, hijo de David, no temas recibir a María por mujer, porque lo que en ella es concebido, del Espíritu Santo es. \'”(<a href=\"https://www.biblestudytools.com/matthew/1-20.html\">Matt. 1:20</a>).</p></blockquote>\r\n										<p>¿Por qué tenía miedo José? La respuesta obvia es que temía que Mary estuviera involucrada o hubiera estado con otro hombre, que ella fuera inmoral y no la persona que él creía que era. Como no había oído de Dios en ese momento, ¿cómo podía creerle a María? ¿Cómo podría confiar en ella? ¿Cómo podría criar al hijo de otro hombre? .</p>\r\n										<h3>3. Por fe, José recibió orientación y revelación</h3>\r\n										<p>Los caminos de Dios a menudo me desconciertan. Si hubiera estado dirigiendo los acontecimientos de la primera Navidad, habría evitado la tensión y el malentendido entre María y José enviando el ángel a José antes de que se reuniera con María. Le habría advertido sobre la necesidad de huir antes de que media noche tuvieran que irse. Pero los caminos de Dios no son mis caminos: son mejores (Isaías 55:9). Y también lo es su momento. Dios envió a José la dirección que necesitaba cuando la necesitaba, no antes. Él hará lo mismo por mí.</p>\r\n										<h3>4. Por fe José obedeció a Dios</h3>\r\n										<p>José demuestra la obediencia de la fe. Tres veces cuando un ángel le habló en sueños, él inmediatamente obedeció. Su rápida respuesta significó huir, tal vez a pie, dejando atrás lo que no podían cargar y comenzar de nuevo en un nuevo lugar (Lucas 2:13). Alguien de menor fe podría haber esperado para terminar y recibir el pago por el proyecto de carpintería en el que estaba trabajando. </p>\r\n									</div>\r\n									<div class=\"blog-description-article mt-3\">\r\n										<h2>Conclusión</h2>\r\n										<p>En Navidad, nosotros (especialmente los padres y abuelos) no queremos que nuestros seres queridos se sientan decepcionados o menos que sus amigos. Esto puede presionarnos a gastar más de lo que deberíamos. Aprecio que la historia de Navidad muestre la humildad de José. En la circuncisión de Jesús, el mismo Hijo de Dios, María y José no ofrecieron un cordero, sino la ofrenda menor de un par de tórtolas o pichones. Charles Ryrie dice en la Biblia de Estudio Ryrie que esto muestra la pobreza de la familia.</p>\r\n										<p>Cuando nos sentimos tentados a reaccionar, sentir lástima de nosotros mismos, retrasar la obediencia o excedernos en esta temporada, que el ejemplo de José refuerce nuestra fe para vivir con valentía y en sintonía con nuestro Salvador.</p>\r\n									</div>', '<div class=\"blog-description-article\">\r\n										<h2>Introduction</h2>\r\n										<p>La vision de Noël de mon enfance était colorée, propre et agréable. Je me souviens que papa marchait dans l\'allée de l\'église à Noël en chantant « We Three Kings ». J\'avais aussi une vue aseptisée des chameaux – jusqu\'à ce que j\'en visite un qui était sale, de son propre choix. Il projetait parfois ses saletés en direction des spectateurs. Ma vision romantique d’une écurie et du voyage des trois mages a disparu.</p>\r\n										<p>Finie également l’idée enfantine selon laquelle le premier Noël était synonyme de joie et de paix pour les personnages principaux. Marie et Joseph ont vécu une multitude d\'émotions et de défis, notamment la trahison, la peur et la solitude. En d’autres termes, le premier Noël offre beaucoup d’espoir aux personnes réelles dans un monde déchu dont les célébrations des fêtes sont loin d’être à la hauteur de l’idéal mythique.</p>\r\n										<p>La plupart d’entre nous connaissent Mary. Mais Joseph mérite également un examen plus approfondi. Considérons cinq leçons tirées de la foi de Joseph lors de ce premier Noël.</p>\r\n									</div>\r\n									<div class=\"blog-description-article mt-3\">\r\n										<h2>Choisir votre portefeuille</h2>\r\n										<p>La bonté et la piété vont de pair. En fait, les Proverbes nous disent que les justes font preuve de respect même envers leurs animaux (Proverbes 12 : 10). Notre culture souffre d’un manque de gentillesse. Les commentaires haineux sur les réseaux sociaux montrent même des croyants démolir d’autres croyants. L’exemple de bonté de Joseph peut nous apprendre beaucoup sur la foi au milieu de la déception.</p>\r\n										<p>D’un point de vue humain, Joseph avait parfaitement le droit d’être en colère. Son fiancé a quitté la ville de manière inattendue pendant trois mois et est revenu enceinte de trois mois ! Son histoire sur la visite d’un ange et le fait d’être toujours vierge – mais enceinte – a dû l’ébranler.</p>\r\n										<p>Comment a-t-il pu se tromper à ce point sur le caractère de Mary ? Et pourquoi aurait-elle inventé une histoire aussi ridicule sur la visite d’un ange pour couvrir sa trahison ?</p>\r\n										<h3>1. Par la foi Joseph a fait preuve de gentillesse sous la pression</h3>\r\n										<p>Nunc viverra eleifend sapien ac blandit. Nam id elit tempor, tempor ante at, euismod nisl. Nullam ante lectus, luctus eget porttitor ut, dignissim non urna. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut turpis quam, porttitor vel vestibulum ut, venenatis non eros. In hac habitasse platea dictumst.</p>\r\n										<h3>2. Par la foi, Joseph a fait preuve de courage</h3>\r\n										<blockquote><p>“Mais après qu\'il eut réfléchi, un ange du Seigneur lui apparut en songe et lui dit : « Joseph, fils de David, ne crains pas de prendre Marie pour épouse, car ce qui est conçu en elle vient du Saint-Esprit. \'” (<a href=\"https://www.biblestudytools.com/matthew/1-20.html\">Matt. 1:20</a>).</p></blockquote>\r\n										<p>Pourquoi Joseph avait-il peur ? La réponse évidente est qu’il craignait que Mary soit impliquée ou ait été avec un autre homme, qu’elle soit immorale et qu’elle ne soit pas la personne qu’il croyait qu’elle était. Puisqu’il n’avait pas eu de nouvelles de Dieu à ce moment-là, comment pouvait-il croire Marie ? Comment pourrait-il un jour lui faire confiance ? Comment pourrait-il élever l’enfant d’un autre homme ? .</p>\r\n										<h3>3.Par la foi, Joseph a reçu des conseils et des révélations</h3>\r\n										<p>Les voies de Dieu me déroutent souvent. Si j\'avais dirigé les événements du premier Noël, j\'aurais évité la tension et l\'incompréhension entre Marie et Joseph en envoyant l\'ange à Joseph avant qu\'il ne rencontre Marie. Je l\'aurais prévenu de leur nécessité de fuir avant le milieu de la nuit où ils devaient partir. Mais les voies de Dieu ne sont pas mes voies : elles sont meilleures (Ésaïe 55 : 9). Et son timing aussi. Dieu a envoyé à Joseph la direction dont il avait besoin quand il en avait besoin, pas avant. Il fera la même chose pour moi. </p>\r\n										<h3>4.Par la foi, Joseph a obéi à Dieu</h3>\r\n										<p>Joseph démontre l\'obéissance de la foi. Trois fois, lorsqu\'un ange lui parlait en rêve, il obéissait immédiatement. Sa réponse rapide signifiait s’enfuir, peut-être à pied, en laissant derrière eux ce qu’ils ne pouvaient pas transporter et en recommençant dans un nouvel endroit (Luc 2 : 13). Quelqu\'un de moindre foi aurait pu attendre de terminer et d\'être payé pour le projet de menuiserie sur lequel il travaillait.</p>\r\n									</div>\r\n									<div class=\"blog-description-article mt-3\">\r\n										<h2>Conclusion</h2>\r\n										<p>À Noël, nous — surtout les parents et les grands-parents — ne voulons pas que nos proches se sentent déçus ou moins que leurs amis. Cela peut nous pousser à dépenser plus que nous ne le devrions. J\'apprécie que l\'histoire de Noël montre l\'humilité de Joseph. Lors de la circoncision de Jésus – le Fils même de Dieu – Marie et Joseph n’ont pas offert un agneau, mais une moindre offrande composée d’un couple de colombes ou de pigeons. Charles Ryrie dit dans la Ryrie Study Bible que cela montre la pauvreté de la famille.</p>\r\n										<p>Lorsque nous sommes tentés de réagir, de nous apitoyer sur notre sort, de retarder l’obéissance ou d’en abuser cette saison, puisse l’exemple de Joseph renforcer notre foi pour vivre courageusement et en accord avec notre Sauveur.</p>\r\n									</div>', 1, 21, 0, 0, 'Joseph-Faith-at-Christmas-12345', 'aprendemos-de-la-fe-de-José-en-Navidad-12345', 'apprenons-de-la-foi-de-Joseph-à-Noël', 46, '2023-11-25 07:36:40');
